re sur la culture de ses destinations.\"},{\"image\":{},\"name\":\"Le Voyageur Écolo 🌿\",\"description\":\"Tu privilégies un tourisme durable et respectueux de l’environnement. Tu choisis des hébergements écologiques, évite les destinations surexploitées, et préfères souvent les transports en commun ou les moyens de transport doux comme le vélo. Sensible à la préservation des lieux visités, tu soutiens les initiatives locales et les pratiques respectueuses de la planète.\"},{\"image\":{},\"name\":\"Le Voyageur de Luxe 🍾\",\"description\":\"Tu cherches avant tout le confort et l’exclusivité. Tu privilégies les hôtels étoilés, les spas, les expériences gastronomiques et les services haut de gamme. Pour toi, les voyages sont l’occasion de te détendre et de te faire plaisir, en profitant de tout ce que les destinations peuvent offrir de raffiné et de prestigieux.\"}],\"questions\":[{\"image\":{\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABOMAAAHvCAYAAAAW4hsBAAAAAXNSR0IArs4c6QAAIABJREFUeF7svWmXHdd1Jbjj3hjemHMmgMQMEARBgjMlkbREDaZlV7sG2XKt6qouq9tt1y+otapX/4r+2L265PKqXh7osgaXustWyTJFypJJiYMIgCNITMSUmcj5zRFx7+11zo3ITICUkAABECTOk54Syhcvhv3inbxnn332CVz3ooM8BAFBQBAQBAQBQUAQEAQEAUFAEBAEBAFBQBAQBAQBQeCmIxAIGXfTMZYDCAKCgCAgCAgCgoAgIAgIAoKAICAICAKCgCAgCAgCjICQcXIjCAKCgCAgCAgCgoAgIAgIAoKAICAICAKCgCAgCAgCtwgBIeNuEdByGEFAEBAEBAFBQBAQBAQBQUAQEAQEAUFAEBAEBAFBQMg4uQcEAUFAEBAEBAFBQBAQBAQBQUAQEAQEAUFAEBAEBIFbhICQcbcIaDmMICAICAKCgCAgCAgCgoAgIAgIAoKAICAICAKCgCAgZJzcA4KAICAICAKCgCAgCAgCgoAgIAgIAoKAICAICAKCwC1CQMi4WwS0HEYQEAQEAUFAEBAEBAFBQBAQBAQBQUAQEAQEAUFAEBAyTu4BQUAQEAQEAUFAEBAEBAFBQBAQBAQBQUAQEAQEAUHgFiEgZNwtAloOIwgIAoKAICAICAKCgCAgCAgCgoAgIAgIAoKAICAICBkn94AgIAgIAoKAICAICAKCgCAgCAgCgoAgIAgIAoKAIHCLEBAy7hYBLYcRBAQBQUAQEAQEAUFAEBAEBAFBQBAQBAQBQUAQEASEjJN7QBAQBAQBQUAQEAQEAUFAEBAEBAFBQBAQBAQBQUAQuEUICBl3i4CWwwgCgoAgIAgIAoKAICAICAKCgCAgCAgCgoAgIAgIAkLGyT0gCAgCgoAgIAgIAoKAICAICAKCgCAgCAgCgoAgIAjcIgSEjLtFQMthBAFBQBAQBAQBQUAQEAQEAUFAEBAEBAFBQBAQBAQBIePkHhAEBAFBQBAQBAQBQUAQEA
